import "../styling/homePage.css";
import React, { useState, useEffect } from "react";
import TeamTile from "../components/teamTile";

function HomePage() {
  const [teams, setTeams] = useState();

  useEffect(() => {
    const fetchTeams = async () => {
      const responce = await fetch("http://localhost:8081/dashboard/allTeams");
      const data = await responce.json();
      setTeams(data);
    };
    fetchTeams();
  }, []);

  if (!teams) {
    return "Data Not Fetched";
  }

  const [t, setT] = useState([teams]);
  const [selectedTeam1, setSelectedTeam1] = useState(null);

  return (
    // <div className="homePage">
    //     {teams.map(m => <TeamTile name = {m.teamName} />)}
    // </div>

    <div>
      {/* <label for="cars">Choose team1: </label>

        <select name="cars" id="cars">
            {teams.map( m => <option value={m.teamName}>{m.teamName}</option> )}
        </select>

        <label for="cars">Choose team1: </label>

        <select name="cars" id="cars">
            {teams.map( m => <option value={m.teamName}>{m.teamName}</option> )}
        </select> */}

      <label for="team1">Choose team1: </label>
        <select
          name="team1"
          id="team1"
          onChange={(event) => setSelectedTeam1(event.target.value)}
        >
          {teams.map((team) => (
            <option key={team.teamName} value={team.teamName}>
              {team.teamName}
            </option>
          ))}
        </select>

      <label for="team2">Choose team2: </label>
        <select name="team2" id="team2">
          {teams
            .filter((team) => team.teamName !== selectedTeam1)
            .map((team) => (
              <option key={team.teamName} value={team.teamName}>
                {team.teamName}
              </option>
            ))}
        </select>
    </div>
  );
}

export default HomePage;
